  const { numero_atendimento } = useParams();

  // Fetch patient data using the numero_atendimento from your API
  // ...

  return (
    <div>
      <h1>Patient Report for {numero_atendimento}</h1>
      {/* Render patient data here */}
    </div>
  );
};

export default PatientReport;
